import React from 'react';
import { Carousel } from 'antd';
import styled from 'styled-components';

const ContentStyle = styled.div`
  background-image: url(${props=>props.background});
  background-size: cover;
  height: 80vh;
  color: #fff;
  text-align: center;
  margin-top:10vh;
`;


const Main=()=>{
    return (
        <div>
            <Carousel autoplay>
                <ContentStyle background="../img/main1.jpg">
                    <b style={{marginTop:'20vh'}}>리에이블 리에이블 리에이릅</b>
                </ContentStyle>
                <ContentStyle background="../img/main1.jpg">
                    <b>어쩌고 저쩌고</b>
                </ContentStyle>
                <ContentStyle background="../img/main1.jpg">
                    <b>메인 페이지</b>
                </ContentStyle>

            </Carousel>
        </div>
    );
}

export default Main;
